export const obtenerAsuntos = async() => {
    const response = await fetch("https://nelsontarche.com.ar/api/obtenerAsuntos.json", {
        'mode': 'no-cors',
        'headers': {
            'Access-Control-Allow-Origin': '*',
        }
    });
    const data = await response.json();
    return data;
}
